    public void LoadIniFileKosatka(string iniName)
    {
      try
      {
        this.KosatkaConfig = ScriptSettings.Load(iniName);
        this.KosatkaOwned = (int) this.KosatkaConfig.GetValue<int>("Kosatka", "KosatkaOwned", (M0) this.KosatkaOwned);
        this.KosatkaVersion = (int) this.KosatkaConfig.GetValue<int>("Kosatka", "KosatkaVersion", (M0) this.KosatkaVersion);
        this.KosatkaBusinessLevel = (int) this.KosatkaConfig.GetValue<int>("Kosatka", "KosatkaBusinessLevel", (M0) this.KosatkaBusinessLevel);
        if ((uint) this.KosatkaOwned <= 0U)
          return;
        if (this.KosatkaVersion == 1)
        {
          this.KosatkaGarageEnter = new Vector3(-239.8f, 6230.6f, 30.7f);
          this.KosatkaBusinessEnter = new Vector3(-248.5227f, 6211.846f, 30.7f);
        }
        if (this.KosatkaVersion == 2)
        {
          this.KosatkaGarageEnter = new Vector3(1712.3f, 4756.4f, 40.5f);
          this.KosatkaBusinessEnter = new Vector3(1694.762f, 4785.07f, 40.5f);
        }
        if (this.KosatkaVersion == 3)
        {
          this.KosatkaGarageEnter = new Vector3(723.3f, -822.1f, 23.2f);
          this.KosatkaBusinessEnter = new Vector3(759.1611f, -815.9539f, 25.2f);
        }
        if (this.KosatkaVersion == 4)
        {
          this.KosatkaGarageEnter = new Vector3(-104.6f, -1776.4f, 28.1f);
          this.KosatkaBusinessEnter = new Vector3(-116.6468f, -1772.006f, 28.5f);
        }
        if (this.KosatkaVersion == 5)
        {
          this.KosatkaGarageEnter = new Vector3(-1288.7f, -274.6f, 37.8f);
          this.KosatkaBusinessEnter = new Vector3(-1269.125f, -305.5237f, 36f);
        }
        if (this.KosatkaVersion == 6)
        {
          this.KosatkaGarageEnter = new Vector3(-618.2f, 282.6f, 80.5f);
          this.KosatkaBusinessEnter = new Vector3(-599.4969f, 279.7799f, 80.5f);
        }
        this.KosatkaPos = this.KosatkaGarageEnter;
      }
      catch (Exception ex)
      {
        UI.Notify("~r~Error~w~:  Payday Heists/Kosatka.ini Failed To Load.");
