    public float CalculateMaxPay(int min, int max)
    {
      float num = 0.0f;
      Random random = new Random();
      if (min < max)
        num = (float) random.Next(min, max);
      if (min > max)
        num = (float) random.Next(max, min);
      return num;
    }

    public float increaseCurrentPay(int min, int max)
    {
      float num = 0.0f;
      Random random = new Random();
      if (min < max)
      {
        num = (float) random.Next(min, max);
        this.CurrentPay += (int) num;
      }
      if (min > max)
      {
        num = (float) random.Next(max, min);
        this.CurrentPay += (int) num;
      }
      return num;
    }

